import React from "react";

const Layout3Object = {
  type: "div",
  props: {},
  children: [
    {
      type: "Box",
      props: {
        bg: "gray.4",
        h: 200,
        style: { borderRadius: "10px" },
      },
      children: [
        {
          type: "Stack",
          props: {},
          children: [
            {
              type: "Box",
              props: {
                bg: "lime.5",
                style: { borderRadius: "10px 10px 0 0", cursor: "pointer" },
              },
              children: [
                {
                  type: "Center",
                  props: {},
                  children: {
                    type: "Text",
                    props: {},
                    children: "Test",
                  },
                },
              ],
            },
            {
              type: "Grid",
              props: { ml: "xs", mr: "xs" },
              children: ["Item 1", "Item 2", "Item 3"].map((item, index) => ({
                type: "Grid.Col",
                props: { span: 4 },
                children: {
                  type: "Box",
                  props: {
                    bg: "blue.1",
                    h: 60,
                    style: { border: "1px solid #000000", cursor: "pointer" },
                  },
                  children: {
                    type: "Center",
                    props: {},
                    children: item,
                  },
                },
              })),
            },
          ],
        },
      ],
    },
  ],
};

const renderObject = (obj) => {
  const { type, props, children } = obj;
  return React.createElement(
    type,
    props,
    children.map((child) => {
      if (typeof child === "string") {
        return child;
      } else {
        return renderObject(child);
      }
    })
  );
};

const Layout3 = () => {
  return renderObject(Layout3Object);
};

export default Layout3;
